import React, { useState } from "react";
import { useNavigate } from "react-router-dom"; 
import styles from "./contact.css"; 

const Contact = () => {
  const navigate = useNavigate(); 

  const [formData, setFormData] = useState({
    nombre: "",
    email: "",
    mensaje: "",
    foto: null,
  });
  const [respuesta, setRespuesta] = useState("");

  const handleChange = (e) => {
    const { name, value, files } = e.target;
    if (name === "foto") {
      setFormData({ ...formData, foto: files[0] });
    } else {
      setFormData({ ...formData, [name]: value });
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    const dataToSend = new FormData();
    dataToSend.append("nombre", formData.nombre);
    dataToSend.append("email", formData.email);
    dataToSend.append("mensaje", formData.mensaje);
    if (formData.foto) {
      dataToSend.append("foto", formData.foto);
    }

    const res = await fetch("http://localhost:3000/api/contacto", {
      method: "POST",
      body: dataToSend,
    });

    const data = await res.json();
    setRespuesta(data.mensaje);

    setFormData({
      nombre: "",
      email: "",
      mensaje: "",
      foto: null,
    });
  };

  const handleSalir = () => {
    navigate("/home"); 
  };

  return (
    <div className={styles.contactContainer}>
      <h1 className={styles.tituloContacto}>CONTACTA CON NOSOTROS</h1>
      <p className={styles.subtituloContacto}>Escribe aquí dudas o sugerencias</p>
      
      <form onSubmit={handleSubmit} encType="multipart/form-data" className={styles.contactForm}>
        <div className={styles.filaDoble}>
          <input
            type="text"
            name="nombre"
            placeholder="Tu nombre"
            value={formData.nombre}
            onChange={handleChange}
            required
          />
          <input
            type="email"
            name="email"
            placeholder="Tu correo"
            value={formData.email}
            onChange={handleChange}
            required
          />
        </div>

        <div className={styles.filaUnica}>
          <input
            type="file"
            name="foto"
            accept="image/*"
            onChange={handleChange}
          />
        </div>

        <div className={styles.filaUnica}>
          <textarea
            name="mensaje"
            placeholder="Escribe tu mensaje"
            value={formData.mensaje}
            onChange={handleChange}
            required
          />
        </div>

        <button type="submit">Enviar</button>
        <button type="button" onClick={handleSalir}>Salir</button> 
      </form>

      {respuesta && <p>{respuesta}</p>}

      <div className={styles.socialIcons}>
        <a href="https://wa.me/593XXXXXXXXX" target="_blank" rel="noopener noreferrer">
          <i className="fab fa-whatsapp"></i>
        </a>
        <a href="https://www.facebook.com/tupagina" target="_blank" rel="noopener noreferrer">
          <i className="fab fa-facebook"></i>
        </a>
        <a href="https://www.instagram.com/tuusuario" target="_blank" rel="noopener noreferrer">
          <i className="fab fa-instagram"></i>
        </a>
        <a href="https://www.tiktok.com/@tuusuario" target="_blank" rel="noopener noreferrer">
          <i className="fab fa-tiktok"></i>
        </a>
      </div>
    </div>
  );
};

export default Contact;
